import React from 'react'
import { useState } from 'react';
import "./Form.css"
import { uniquedata } from './value';

const Form = () => {
    const[data,setData] = useState(uniquedata)
    
   
  return (
    <div className='form'>
        <h2>Merchant Category Code Finder</h2>
        <div className='row'>
        <div className='form-group'>
            <label>Category</label>
            <select className='form-select' placeholder='select Category'>
               <option>select Category</option>
               {
                data.map((categoryget)=>(
                        <option key={categoryget.mcc}>{categoryget.group.description}</option>
                ))
               
}
            </select>
        </div>

        <div className='form-group'>
            <label>Sub-Category</label>
            <select className='form-select' placeholder='select Category'>
                <option>hree</option>
                
            </select>
        </div>

        <button type='submit' > Submit</button>
        
        
        {
                data.map((categoryget)=>(
                        <li key={categoryget.mcc}>{categoryget.group.description}</li>
                ))
               
}
    </div></div>
  )
}

export default Form
